window.bookSummaryJSON = "<p><b>The inspiration for the MAX original series DUNE: PROPHECY, coming Fall 2024!</b> </p> <p>It is 83 years after the last thinking machines were destroyed in the Battle of Corrin, after Faykan Butler took the name of Corrino and established himself as the first Emperor of a new Imperium.</p> <p>The war hero Vorian Atreides has turned his back on politics and Salusa Secundus. The descendants of the disgraced Abulurd Harkonnen have sworn vengeance against Vor, blaming him for the downfall of their noble family.</p> <p>Raquella Berto-Anirul has formed the Bene Gesserit School and, through a terrible ordeal, has become the first Reverend Mother.</p> <p>The descendants of Aurelius Venport and Norma Cenva use mutated, spice-saturated Navigators who fly precursors of Heighliners.</p> <p>And Gilbertus Albans, ward of the hated thinking machine Erasmus, is teaching humans to become Mentats…while hiding an unbelievable secret.</p> <p>Led by the fanatic Manford Torondo, the Butlerian movement, fiercely opposed to all forms of \"dangerous technology,\" sweeps across the known universe in mobs, millions strong, destroying everything in its path.</p> <p><b>A Macmillan Audio production from Tor Books.</b></p>"; 
